import React, { useEffect, useState } from "react";
import axios from "axios";
import "./CommonForm.css";
import "./MSME.css";

export default function MSME() {
  const initialState = {
    title: "",
    incubateeName: "",
    mentorDetails: "",
    ideaSector: "",
    totalCost: "",
    problemStatement: "",
    msmePdf: null,
  };

  const [formData, setFormData] = useState(initialState);
  const [msmes, setMsmes] = useState([]);
  const [fileKey, setFileKey] = useState(Date.now());

  const fetchMSME = async () => {
    const res = await axios.get("http://localhost:5000/api/msme"); // âœ…
    setMsmes(res.data);
  };

  useEffect(() => {
    fetchMSME();
  }, []);

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    setFormData({ ...formData, [name]: files ? files[0] : value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const data = new FormData();
    Object.keys(formData).forEach((key) =>
      data.append(key, formData[key])
    );

    await axios.post("http://localhost:5000/api/msme", data);
    alert("MSME saved âœ…");

    setFormData(initialState);
    setFileKey(Date.now());
    fetchMSME();
  };

  return (
    <>
      {/* ===== CARDS ===== */}
      {msmes.length > 0 && (
        <div className="msme-section">
          <h3 className="msme-title">Your MSME Submissions</h3>

          <div className="msme-grid">
            {msmes.map((m) => (
              <div className="msme-card" key={m._id}>
                <h4 className="msme-card-title">{m.title}</h4>

                <div className="msme-row">
                  <span className="msme-label">Sector</span>
                  <span className="msme-colon">:</span>
                  <span className="msme-value">{m.ideaSector}</span>
                </div>

                <div className="msme-row">
                  <span className="msme-label">Cost</span>
                  <span className="msme-colon">:</span>
                  <span className="msme-value">â‚¹ {m.totalCost}</span>
                </div>

                <div className="msme-row">
                  <span className="msme-label">Incubatee</span>
                  <span className="msme-colon">:</span>
                  <span className="msme-value">{m.incubateeName}</span>
                </div>
              </div>
            ))}
          </div>
        </div>
      )}

      {/* ===== FORM ===== */}
      <div className="form-wrapper">
        <h3 className="form-title">MSME Details</h3>

        <form className="form-grid" onSubmit={handleSubmit}>
          <input name="title" placeholder="Title" value={formData.title} onChange={handleChange} required />
          <input name="incubateeName" placeholder="Incubatee Name" value={formData.incubateeName} onChange={handleChange} />
          <input name="mentorDetails" placeholder="Mentor Details" value={formData.mentorDetails} onChange={handleChange} />
          <input name="ideaSector" placeholder="Idea Sector" value={formData.ideaSector} onChange={handleChange} />
          <input type="number" name="totalCost" placeholder="Total Cost" value={formData.totalCost} onChange={handleChange} />

          <textarea
            className="full-width"
            name="problemStatement"
            placeholder="Problem Statement"
            value={formData.problemStatement}
            onChange={handleChange}
          />

          <input
            key={fileKey}
            type="file"
            name="msmePdf"   // ðŸ”¥ MUST MATCH multer
            accept="application/pdf"
            onChange={handleChange}
            required
          />

          <button className="submit-btn">Save MSME</button>
        </form>
      </div>
    </>
  );
}
